import './R.css';

function Register() {

    return (
        <>
            <div class="bgimage">
                {/* <div class="menu">
                    <h1>Payroll Management System</h1>
                </div> */}
                <div class="text">
                    <h4>Designed a payroll management system</h4>
                    <h1> Payroll </h1>
                    <h3> Payroll is about more than just giving out paychecks - it's about building a culture of trust and fairness </h3>
                    <button class="home_btn"> Explore</button>
                    {/* <button class="btn"> Subscribe</button> */}
                </div>

            </div>
        </>
    );
}

export default Register;
